import React, {useEffect} from 'react';
import {useAppDispatch, useAppSelector} from "../hooks/redux";
import classes from '../styles/Bars/SubcategoryBar.module.scss'
import {fetchCategories} from "../store/CategoryActionCreators";

const SubcategoryBar = () => {
    const {subcategories, loading, error, currentSubcategory} = useAppSelector(state => state.subcategoryReducer)
    const dispatch = useAppDispatch()

    useEffect(() => {
        dispatch(fetchSubcategories())
    }, [])

    return (
        <div className={classes['SubcategoryBar']}>
            {subcategories &&
                <div>

                </div>
            }
        </div>
    );
};

export default SubcategoryBar;
